import React, { Component } from "react";
import axios from 'axios';
class book extends Component {
    state = {
        details: {start_time: '', end_time :'' , resource_id :'' }
    }
    det = {
        'id' : 1,
        'resource_id':1,
        'date':"20-08-2020",
        'start_time' :"7:00",
        'end_time' : "8:00",
    }
  
   handleChange = (event) => {
    const cred = this.state.details;
